import React from 'react'

// import link
import { Link } from 'react-router-dom'
// import images
import intLOGO from '../../assets/images/interactlogo.SVG'
// import components



const Header = () => {
  return (
    <>
      <header className='relative top-0 z-[20] mx-auto flex w-full items-center justify-between'>
      <img className='h-20 w-40' src={intLOGO} alt="" />
      <div className="w-1/3 justify-between text-center">
        <Link to='/'>Home</Link> 
        <Link to='/'>About</Link> 
        <Link to='/'>Activities</Link> 
        <Link to='/'>Contact</Link> 
      </div>
      </header>
    </>
  )
}

export default Header
